import styled from '@emotion/styled'

const ContactAddFormEl = styled.form`
  display: flex;
  flex-direction: column;
  border: 2px solid black;
  width: 400px;
  padding: 20px;
  margin-bottom: 20px;
`
export default ContactAddFormEl
